import logo from './images/jamestraphotography_FINALblueorange_1.png';
import './App.css';
// import './normalize.css';
import HeroBanner from './components/HeroBanner';
import MiniAbout from './components/MiniAbout';

function App() {
  return (
    <div>
      <nav>
        <div className="nav-title">
          <img src={logo} alt="Jam Chan Logo" title="Home" />
          <h1>Jam Chan <br /> Photography</h1>
        </div>
        <div className="nav-links">
          <a href="">About</a>
          <a href="">Gallery</a>
          <a href=""> Stock Photos</a>
          <a href="">Contact</a>
        </div>
      </nav>
      <HeroBanner />
      <MiniAbout />
    </div>
  );
}

export default App;
